    return (
        <div className="wrapper-Movies">
            <div className="cart">
                <figure className="img">
                  <img src={"https://image.tmdb.org/t/p/w500/"+movie.poster_path}/>
                </figure>
                    <div className="infoMoveis">
                    <div>
                     <h3>{movie.title} </h3>
                        <span className="time">{
                            
                        } </span>
                    </div>
                       
                        <div>
                        <div className='badge outline'>HD</div>
                       <span>
                       <i class="fa-solid fa-star"></i>
                       {movie.vote_average}
                       </span>
                        </div>
                    </div>
            </div>
        </div>
    )
}

